import React, { useState } from 'react';
import './App.css';

function App() {

  const [amount, setAmount] = React.useState("");
  const [type, setType] = React.useState("");
  const [worth, setWorth] = React.useState("");
  const [income, setIncome] = React.useState(false);
  const [credit, setCredit] = React.useState(false);

  const [submitting, setSubmitting] = useState(false);
  const handleSubmit = event => {
    event.preventDefault();
   setSubmitting(true);

    console.log(`
      Amount: ${amount}
      Type: ${type}
      Worth: ${worth}
      Income: ${income}
      Credit: ${credit}
    `);

   setTimeout(() => {
     setSubmitting(false);
   }, 3000)
 }

  const handleChange = event => {
  }

  return(
    <div className="wrapper">
      <h1>Lorum Ipsem Lorum Ipsem Lorum Ipsem</h1>
      {submitting &&
       <div>Submtting Form...</div>
     }

      <form onSubmit={handleSubmit}>
        <fieldset><label>

            <div class="myself"><br/>

            <div class="property">Investment Amount:</div>
            <div class="value"><input type="number" name="amount"
                value={amount}  
                onChange={e => setAmount(e.target.value)} required/>
            </div><br/><br/>

            <div class="property">Investment Type:</div>
            <div class="value"><input type="text" name="type"
                 value={type}
                 onChange={e => setType(e.target.value)} required/>
            </div><br/><br/>

            <div class="property">Total Net Worth </div>
            <div class="value"><input type="number" name="worth" value={worth}/></div><br/><br/>

            <div class="property">User Estimated Yearly Income </div>
            <div class="value"><input type="number" name="income" value={income}/></div><br/><br/>

            <div class="property">User Estimated Credit Score </div>
            <div class="value"><input type="number" name="credit" min="300" max="850" value={credit}/></div><br/><br/>

            </div>

        </label></fieldset>
        <button type="submit">Submit</button>
      </form>
    </div>
  )
}

export default App;
